<!DOCTYPE html>
<html>
    <head>
        <title>For In Loops</title>
    <script>
    window.onload=function()
    {
        var myObject = {a: 93, b: 72, c: 56, d: 88, e: 85, f: 91};
        var myKeys = [];
        var i = 0;
        
        for(myKeys[i++] in myObject)
            console.log(myKeys);
        
    }
        
    </script>
    </head>
    <body>
       <h1>My Results are found in the console.</h1>
        <div id="result"></div>
    </body>
</html>
